import React, { useState } from 'react';
import { YourComponent } from './components/GraphComponent'; // Исправлено на импорт по умолчанию
import VHDLEditorWithCompiler from './components/Editor';
function App() {


  return (
    <>
      <VHDLEditorWithCompiler />
      <YourComponent/>

    </>
  );
}

const observerErrorHandler = (error) => {
  if (error.message === 'ResizeObserver loop completed with undelivered notifications.') {
    return; // Игнорируем предупреждение
  }
  console.error(error); // Показываем остальные ошибки
};

window.addEventListener('error', observerErrorHandler);



export default App;
